import Layout from "../components/layout";
import PraxisText from "../components/praxisText";

const Praxis = () => {
	return (
		<Layout>
			<div className='container'>
				<PraxisText></PraxisText>
			</div>
		</Layout>
	);
};

export default Praxis;
